import React from "react";

class List extends React.Component {
  constructor() {
    super();
    this.state = {
      users: [
        {
          name: "test",
          age: 20,
        },
        {
          name: "test2",
          age: 20,
        },
        {
          name: "test3",
          age: 20,
        },
        {
          name: "test4",
          age: 20,
        },
      ],
      isAdmin:false
    };
  }
  render() {
    return (
      <div>
        <input type="text" value="hello"/>
        {this.state.isAdmin && <h2>hello admin</h2>}
        <ul>
          {this.state.users.map((item) => {
            return <li>{item.name}</li>;
          })}
        </ul>
      </div>
    );
  }
}

export default List;
